import Header from "./Header";
import ReminderTitle from "./ReminderTitle";
import "../assets/styles/PaymentReminder.css";
import { Modal } from "react-bootstrap";
import { useEffect, useRef, useState } from "react";
import Reminder from "./Reminder";

function PaymentReminder() {

    let reminders = [];
    const [reminderList, setReminderList] = useState([]);
    const [showAddForm, setShowAddForm] = useState(false);

    async function fetchPaymentReminders() {
        let response = await fetch("http://localhost:7000/api/payment-reminders/fetch/U01", {
            "method":"GET"
        });
        reminders = await response.json();
        console.log(reminders);
        setReminderList(reminders);
    }

    async function deletePaymentReminder(reminderId) {
        let response = await fetch(`http://localhost:7000/api/payment-reminders/delete/${reminderId}`, {
            "method":"DELETE"
        });
        if(response.ok) {
            await fetchPaymentReminders();
        } else {
            throw new Error("Reminder Deletion Failed!");
        }
    }

    async function addPaymentReminder({userId, amount, dueDate, status}) {
        let response = await fetch(`http://localhost:7000/api/payment-reminders/add?userId=${userId}&amount=${amount}&dueDate=${dueDate}&status=${status}`, {
            "method":"POST"
        });
        if(response.ok) {
            await fetchPaymentReminders();
        } else {
            throw new Error("Reminder Addition Failed!");
        }
    }

    useEffect(() => {
        fetchPaymentReminders();
    }, [])
    
    const handleAddReminderForm = () => {
        setShowAddForm(!showAddForm);
    }

    const handleDeleteReminder = (reminderId) => {
        deletePaymentReminder(reminderId);
    }

    const amountRef = useRef();
    const dueDateRef = useRef();
    const statusRef = useRef();

    const handleAddReminder = () => {
        let reminder = {
            userId: "U01",
            amount: Number(amountRef.current.value),
            dueDate: dueDateRef.current.value,
            status: statusRef.current.value
        };
        addPaymentReminder({...reminder});
    }

    return (
        <>
            <Header />
            <ReminderTitle />
            {
                reminderList.map((rem, index) => {
                    return (
                        <Reminder rem = {rem} />
                    )
                })
            }
            <div className="add-pr-div">
                <div className="add-pr-button-container">
                    <button className="add-pr-button" onClick={handleAddReminderForm}>
                        +
                    </button>
                </div>
                <div className={"add-pr-form-container " + ((showAddForm) ? "display-form" : null)}>
                    <div className="add-pr-form-title">
                        <h3>Add Payment Reminder</h3>
                    </div>
                    <div className="add-pr-form">
                        <div className="form-field">
                            <p>Payment amount:</p>
                            <input type="text" placeholder="Enter amount" ref={amountRef} />
                        </div>
                        <div className="form-field">
                            <p>Due date:</p>
                            <input type="text" placeholder="(DD-MM-YYYY)" ref={dueDateRef} />
                        </div>
                        <div className="form-field">
                            <p>Status:</p>
                            <input type="text" placeholder="Enter status" ref={statusRef} />
                        </div>
                        <div className="form-field">
                            <div className="form-button-container">
                                <button onClick={(e) => {handleAddReminder()}}>
                                    Add Reminder
                                </button>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </>
    );
}

export default PaymentReminder;
